/* eslint-disable jsx-a11y/anchor-is-valid */
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import { Layout, Menu, Dropdown } from "antd";
import Icon, { MenuOutlined, DownOutlined, SearchOutlined } from "@ant-design/icons";
import { Input } from "antd";
import "antd/dist/antd.css";
import LogoTiki from "../logoTiki.png";
import "./Navbar.css";

const { Header, Content, Footer } = Layout;



const { Search } = Input;
const suffix = (
  <SearchOutlined  style={{
      fontSize: 16,
      color: "#fff",
    }}/>
);
export default function Navbar() {
  const onSearch = (value) => console.log(value);

  return (
    <div>
      <Router>
        <Layout className="layout">
          <Header className="header-navbar">
            <div className="logo">
              <img src={LogoTiki} alt="logo tiki" width="3%" />
            </div>
            <Menu className="header-navbar" mode="horizontal">
              <Menu.Item key="1">
                <MenuOutlined />
                <Dropdown overlay={danhMucSanPham}>
                  <a
                    className="ant-dropdown-link"
                    onClick={(e) => e.preventDefault()}
                  >
                    Danh mục sản phẩm
                    <DownOutlined />
                  </a>
                </Dropdown>
              </Menu.Item>
              <Menu.Item key="2">
                <Search
                  placeholder="Tìm sản phẩm mong muốn"
                  allowClear
                  onSearch={onSearch}
                  enterButton="Search"
                  suffix={suffix}
                  size="large"
                  style={{ width: 200 }}
                />
              </Menu.Item>
            </Menu>
          </Header>
          <Content style={{ padding: "0 50px" }}>
            <div className="site-layout-content">Content</div>
          </Content>
          <Footer style={{ textAlign: "center" }}>
            Ant Design ©2018 Created by Ant UED
          </Footer>
        </Layout>

        <Switch>
          <Route exact path="/dskhachhang"></Route>
          <Route exact path="/dsnhaban"></Route>
        </Switch>
      </Router>
    </div>
  );
}
